<h1>The property definition folder has a duplicate long name</h1>
<p class="Body">The <a href="../lvhowto/creating_mem_VIs.html#propdeffolder">property definition folder</a> has the same long name as another property definition folder. Each property definition folder must have a unique long name within a LabVIEW class.</p>
